  [],\n\t\"num_tags\": 0,\n\t\"name\": \"potential-impacts-of-ocean-acidification-on-the-puget-sound-food-web-ncei-accession-0134852\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The ecosystem impacts of ocean acidification
  (OA) were explored by imposing scenarios designed to mimic OA on a food web model
  of Puget Sound, a large estuary in the northwestern USA. Productivity of functional
  groups that contain mostly calcifiers was decreased while still allowing other species
  groups to respond to the scenarios in a dynamic way through indirect effects. Results
  focus on changes in ecosystem services and structure. Sometimes, the direct and
  indirect effects of OA countered each other due to interactions between predators
  and prey within the food web, leading to little change in the food web. In other
  cases, direct and indirect effects caused greater change in the food web than anticipated
  from direct effects alone. Results were strongly affected by the group on which
  OA was directly imposed, with changes in copepod productivity being the most influential.
  While there is much uncertainty in our predictions, focusing on the complex interactions
  among species and between species and their environment will yield better understanding
  of how ecosystems may respond to OA.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
